import React from "react";
import { kurtis } from "../assets";
import { CategoryCard } from "./CategoryCard";

export const Categories = () => {
  const categories = [
    {
      name: "Kurta",
      img: kurtis,
    },
    {
      name: "Kurta",
      img: kurtis,
    },
  ];
  return (
    <div>
      {(() => {
        let categorySection;
        for (let category in categories) {
          categorySection += <CategoryCard category={category} />;
        }
        return categorySection;
      })()}
    </div>
  );
};
